import React from 'react';
import './AppContainer.css'

function AppContainer() {
  return (
    <div className="container">
      <div className="calories">
        <h2>Калории:</h2>
      </div>
      <h2>Добавьте продукты</h2>
    </div>
  );
}

export default AppContainer;
